import { Card, Avatar, Button, Col, Row } from "antd";
import CenteralAppLayout from "./CenteralAppLayout";
import NavibarLayout from "./NavibarLayout";
// import { CalendarOutlined } from "@ant-design/icon";

const ProfileCard = () => {
  const dummy = {
    pet: {
      name: "wilson",
      breed: "골든 리트리버",
      birth: 2,
      address: "경기도 성남시 분당구",
      image: "http://www.animaltogether.com/news/photo/201907/167_346_855.jpg",
    },
    owner: { name: "kk" },
  };
  return (
    <CenteralAppLayout>
      <NavibarLayout>
        <Card title={dummy.pet.name} actions={[]} cover={<img src={dummy.pet.image} />}>
          <Card.Meta
            // avatar={<Avatar src={dummy.pet.image} />}
            title={dummy.pet.name}
            description={
              <Row gutter={8}>
                <Col xs={4}>견종</Col>
                <Col xs={8}>{dummy.pet.breed}</Col>
                <Col xs={4}>생일</Col>
                <Col xs={8}>{dummy.pet.birth}</Col>
                <Col xs={4}>주소</Col>
                <Col xs={8}>{dummy.pet.address}</Col>
              </Row>
            }
          />
        </Card>
      </NavibarLayout>
    </CenteralAppLayout>
  );
};

export default ProfileCard;
